<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Charge Master Analytics | Premium Dashboard</title>
    
    <!-- React & DOM -->
    <script crossorigin src="https://unpkg.com/react@18/umd/react.production.min.js"></script>
    <script crossorigin src="https://unpkg.com/react-dom@18/umd/react-dom.production.min.js"></script>
    <script src="https://unpkg.com/@babel/standalone/babel.min.js"></script>
    
    <!-- Libraries: PapaParse (CSV), SheetJS (Excel), Lucide (Icons) -->
    <script src="https://unpkg.com/papaparse@5.4.1/papaparse.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/xlsx/0.18.5/xlsx.full.min.js"></script>
    <script src="https://unpkg.com/lucide@latest"></script>
    
    <!-- Tailwind CSS -->
    <script src="https://cdn.tailwindcss.com"></script>
    <script>
        tailwind.config = {
            theme: {
                extend: {
                    colors: {
                        brand: {
                            50: '#f0f9ff',
                            100: '#e0f2fe',
                            500: '#0ea5e9',
                            600: '#0284c7',
                            800: '#075985',
                            900: '#0c4a6e',
                        },
                        slate: {
                            850: '#152033', 
                        }
                    },
                    fontFamily: {
                        sans: ['Inter', 'system-ui', 'sans-serif'],
                    },
                    animation: {
                        'pulse-slow': 'pulse 3s cubic-bezier(0.4, 0, 0.6, 1) infinite',
                    }
                }
            }
        }
    </script>
    
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700&display=swap');
        
        body { font-family: 'Inter', sans-serif; background-color: #f1f5f9; }
        
        /* Custom Scrollbar */
        ::-webkit-scrollbar { width: 8px; height: 8px; }
        ::-webkit-scrollbar-track { background: transparent; }
        ::-webkit-scrollbar-thumb { background: #cbd5e1; border-radius: 4px; }
        ::-webkit-scrollbar-thumb:hover { background: #94a3b8; }
        
        .glass-panel {
            background: rgba(255, 255, 255, 0.95);
            backdrop-filter: blur(12px);
            border: 1px solid rgba(255, 255, 255, 0.2);
        }
        
        .animate-fade-in { animation: fadeIn 0.5s ease-out; }
        @keyframes fadeIn { from { opacity: 0; transform: translateY(10px); } to { opacity: 1; transform: translateY(0); } }

        /* Chart Animations */
        .bar-fill { transition: width 1s cubic-bezier(0.4, 0, 0.2, 1); }
    </style>
</head>
<body class="text-slate-800 h-screen overflow-hidden flex flex-col">

    <div id="root" class="h-full flex flex-col"></div>

    <script type="text/babel">
        const { useState, useEffect, useMemo } = React;

        // --- Icons ---
        const Icon = ({ name, size = 18, className = "" }) => {
            const iconRef = React.useRef(null);
            
            useEffect(() => {
                if (window.lucide) {
                    window.lucide.createIcons({
                        root: iconRef.current ? iconRef.current.parentNode : document,
                        nameAttr: 'data-lucide',
                        attrs: {
                            class: `lucide lucide-${name} ${className}`,
                            width: size,
                            height: size,
                        }
                    });
                }
            }, [name, className]);

            return <i ref={iconRef} data-lucide={name} className={className}></i>;
        };

        // --- Components ---

        const Modal = ({ isOpen, onClose, title, children }) => {
            if (!isOpen) return null;
            return (
                <div className="fixed inset-0 z-50 flex items-center justify-center bg-black/50 backdrop-blur-sm p-4 animate-fade-in">
                    <div className="bg-white rounded-xl shadow-2xl w-full max-w-3xl max-h-[90vh] flex flex-col overflow-hidden">
                        <div className="flex justify-between items-center p-6 border-b border-slate-100">
                            <h3 className="text-xl font-bold text-slate-800">{title}</h3>
                            <button onClick={onClose} className="p-2 hover:bg-slate-100 rounded-full transition-colors">
                                <Icon name="x" size={20} className="text-slate-500" />
                            </button>
                        </div>
                        <div className="p-6 overflow-y-auto bg-slate-50">
                            {children}
                        </div>
                    </div>
                </div>
            );
        };

        const EmptyState = ({ onFileUpload, error }) => (
            <div className="flex-1 flex flex-col items-center justify-center p-8 bg-slate-50 relative overflow-hidden">
                <div className="absolute inset-0 bg-[url('https://www.transparenttextures.com/patterns/cubes.png')] opacity-5"></div>
                
                <div className="z-10 bg-white p-10 rounded-2xl shadow-xl border border-slate-200 text-center max-w-lg w-full">
                    <div className="w-20 h-20 bg-brand-50 rounded-full flex items-center justify-center mx-auto mb-6">
                        <Icon name="upload-cloud" size={40} className="text-brand-600" />
                    </div>
                    <h1 className="text-3xl font-bold text-slate-800 mb-2">Load Data</h1>
                    <p className="text-slate-500 mb-8">
                        We didn't find any hardcoded data. You can either paste your <strong>CSV</strong> data into the HTML file, or upload a file here.
                    </p>
                    
                    <label className="flex flex-col items-center justify-center w-full h-32 border-2 border-brand-200 border-dashed rounded-lg cursor-pointer bg-brand-50 hover:bg-brand-100 transition-colors group">
                        <div className="flex flex-col items-center justify-center pt-5 pb-6">
                            <p className="mb-2 text-sm text-brand-700 font-medium group-hover:text-brand-800">Click to upload or drag and drop</p>
                            <p className="text-xs text-brand-400">Supports .CSV and .XLSX (Excel)</p>
                        </div>
                        <input type="file" className="hidden" accept=".csv, .xlsx, .xls" onChange={onFileUpload} />
                    </label>

                    {error && (
                        <div className="mt-4 p-3 bg-red-50 text-red-600 text-sm rounded-lg flex items-center gap-2">
                            <Icon name="alert-circle" size={16} />
                            {error}
                        </div>
                    )}
                </div>
                <p className="mt-8 text-slate-400 text-sm">Secure Processing: Data remains in your browser.</p>
            </div>
        );

        const KPICard = ({ title, value, subtext, icon, color }) => (
            <div className="bg-white p-4 rounded-xl border border-slate-100 shadow-sm flex items-center gap-4 transition-all hover:shadow-md">
                <div className={`w-12 h-12 rounded-lg flex items-center justify-center ${color}`}>
                    <Icon name={icon} size={24} className="text-white" />
                </div>
                <div>
                    <p className="text-xs font-semibold text-slate-400 uppercase tracking-wider">{title}</p>
                    <p className="text-xl font-bold text-slate-800">{value}</p>
                    {subtext && <p className="text-xs text-slate-400">{subtext}</p>}
                </div>
            </div>
        );

        const AnalyticsPanel = ({ data }) => {
            const stats = useMemo(() => {
                const typeCounts = {};
                let prices = [];

                data.forEach(row => {
                    const type = row['ACTIVITY_TYPE'] || 'Unknown';
                    typeCounts[type] = (typeCounts[type] || 0) + 1;

                    const rawPrice = row['Charge Point Standard'] || row['Ambulatory Charge Point Tech'] || '0';
                    const cleanPrice = parseFloat(rawPrice.toString().replace(/[$,]/g, ''));
                    if (!isNaN(cleanPrice) && cleanPrice > 0) {
                        prices.push(cleanPrice);
                    }
                });

                const sortedTypes = Object.entries(typeCounts)
                    .sort((a, b) => b[1] - a[1])
                    .slice(0, 5);
                
                const maxCount = sortedTypes.length > 0 ? sortedTypes[0][1] : 1;
                const avgPrice = prices.length ? (prices.reduce((a, b) => a + b, 0) / prices.length) : 0;
                const minPrice = prices.length ? Math.min(...prices) : 0;
                const maxPrice = prices.length ? Math.max(...prices) : 0;

                return { 
                    sortedTypes, 
                    maxCount, 
                    avgPrice: avgPrice.toLocaleString('en-US', { style: 'currency', currency: 'USD' }),
                    minPrice: minPrice.toLocaleString('en-US', { style: 'currency', currency: 'USD' }),
                    maxPrice: maxPrice.toLocaleString('en-US', { style: 'currency', currency: 'USD' }),
                    hasPrices: prices.length > 0
                };
            }, [data]);

            if (data.length === 0) return null;

            return (
                <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-6 animate-fade-in">
                    <div className="bg-white p-5 rounded-xl border border-slate-200 shadow-sm">
                        <h3 className="text-sm font-bold text-slate-700 mb-4 flex items-center gap-2">
                            <Icon name="bar-chart-2" size={16} className="text-brand-500" />
                            Activity Distribution
                        </h3>
                        <div className="space-y-3">
                            {stats.sortedTypes.map(([type, count], idx) => (
                                <div key={idx} className="w-full">
                                    <div className="flex justify-between text-xs mb-1">
                                        <span className="font-medium text-slate-600">{type}</span>
                                        <span className="text-slate-400">{count}</span>
                                    </div>
                                    <div className="w-full bg-slate-100 rounded-full h-2">
                                        <div 
                                            className="bg-brand-500 h-2 rounded-full bar-fill" 
                                            style={{ width: `${(count / stats.maxCount) * 100}%` }}
                                        ></div>
                                    </div>
                                </div>
                            ))}
                        </div>
                    </div>

                    <div className="bg-white p-5 rounded-xl border border-slate-200 shadow-sm flex flex-col justify-between">
                        <h3 className="text-sm font-bold text-slate-700 mb-4 flex items-center gap-2">
                            <Icon name="dollar-sign" size={16} className="text-emerald-500" />
                            Cost Analysis (Filtered)
                        </h3>
                        {stats.hasPrices ? (
                            <div className="grid grid-cols-3 gap-4">
                                <div className="p-3 bg-slate-50 rounded-lg text-center">
                                    <p className="text-xs text-slate-500 uppercase">Average</p>
                                    <p className="text-sm font-bold text-slate-800 mt-1">{stats.avgPrice}</p>
                                </div>
                                <div className="p-3 bg-emerald-50 rounded-lg text-center">
                                    <p className="text-xs text-emerald-600 uppercase">Lowest</p>
                                    <p className="text-sm font-bold text-emerald-800 mt-1">{stats.minPrice}</p>
                                </div>
                                <div className="p-3 bg-blue-50 rounded-lg text-center">
                                    <p className="text-xs text-blue-600 uppercase">Highest</p>
                                    <p className="text-sm font-bold text-blue-800 mt-1">{stats.maxPrice}</p>
                                </div>
                            </div>
                        ) : (
                            <div className="flex-1 flex items-center justify-center text-slate-400 text-sm italic">
                                No price data detected in current filter
                            </div>
                        )}
                        <div className="mt-4 pt-4 border-t border-slate-100 text-xs text-slate-400">
                             Based on {data.length} filtered items
                        </div>
                    </div>
                </div>
            );
        };

        const DetailRow = ({ label, value }) => {
            if (!value) return null;
            return (
                <div className="flex flex-col py-3 border-b border-slate-100 last:border-0">
                    <span className="text-xs font-semibold text-slate-400 uppercase tracking-wider mb-1">{label}</span>
                    <span className="text-sm font-medium text-slate-800 break-words">{value}</span>
                </div>
            );
        }

        const App = () => {
            const [data, setData] = useState([]);
            const [filteredData, setFilteredData] = useState([]);
            const [columns, setColumns] = useState([]);
            const [loading, setLoading] = useState(true);
            const [searchTerm, setSearchTerm] = useState("");
            const [error, setError] = useState(null);
            const [selectedRow, setSelectedRow] = useState(null);
            const [fileName, setFileName] = useState("Embedded Data");

            // --- AUTO LOAD LOGIC ---
            useEffect(() => {
                // Check if the user pasted data into the script tag below
                const localData = document.getElementById('hardcoded-csv-data').textContent.trim();
                
                if (localData && localData !== "PASTE_YOUR_CSV_CONTENT_HERE") {
                    // Data found! Parse it immediately.
                    Papa.parse(localData, {
                        header: true,
                        skipEmptyLines: true,
                        complete: (results) => {
                            if (results.data && results.data.length > 0) {
                                setData(results.data);
                                setFilteredData(results.data);
                                setColumns(Object.keys(results.data[0]));
                                setFileName("Embedded Dataset");
                            } else {
                                setError("The embedded data appears empty.");
                            }
                            setLoading(false);
                        },
                        error: (err) => {
                            setError("Error parsing embedded CSV: " + err.message);
                            setLoading(false);
                        }
                    });
                } else {
                    // No data pasted, show upload screen
                    setLoading(false);
                }
            }, []);

            const handleFileUpload = (event) => {
                const file = event.target.files[0];
                if (!file) return;

                setLoading(true);
                setFileName(file.name);
                setError(null);

                const isExcel = file.name.endsWith('.xlsx') || file.name.endsWith('.xls');

                if (isExcel) {
                    // EXCEL PARSING LOGIC
                    const reader = new FileReader();
                    reader.onload = (e) => {
                        try {
                            const data = new Uint8Array(e.target.result);
                            const workbook = XLSX.read(data, {type: 'array'});
                            const firstSheetName = workbook.SheetNames[0];
                            const worksheet = workbook.Sheets[firstSheetName];
                            // Parse to JSON
                            const jsonData = XLSX.utils.sheet_to_json(worksheet, {raw: false, defval: ""});
                            
                            if (jsonData && jsonData.length > 0) {
                                setData(jsonData);
                                setFilteredData(jsonData);
                                setColumns(Object.keys(jsonData[0]));
                            } else {
                                setError("Excel file appears to be empty.");
                            }
                            setLoading(false);
                        } catch (err) {
                            setError("Error reading Excel file: " + err.message);
                            setLoading(false);
                        }
                    };
                    reader.readAsArrayBuffer(file);

                } else {
                    // CSV PARSING LOGIC
                    Papa.parse(file, {
                        header: true,
                        skipEmptyLines: true,
                        complete: (results) => {
                            if (results.data && results.data.length > 0) {
                                setData(results.data);
                                setFilteredData(results.data);
                                setColumns(Object.keys(results.data[0]));
                            } else {
                                setError("The file appears to be empty or invalid.");
                            }
                            setLoading(false);
                        },
                        error: (err) => {
                            setError("Error parsing CSV: " + err.message);
                            setLoading(false);
                        }
                    });
                }
            };

            useEffect(() => {
                if (!searchTerm) {
                    setFilteredData(data);
                    return;
                }
                const lowerTerm = searchTerm.toLowerCase();
                const filtered = data.filter(row => {
                    const cpt = row['CPT'] || '';
                    const longDesc = row['LONG_DESCRIPTION'] || '';
                    const shortDesc = row['SHORT_DESCRIPTION'] || '';
                    const billId = row['BILL_ITEM_ID'] || '';
                    
                    return cpt.toLowerCase().includes(lowerTerm) || 
                           longDesc.toLowerCase().includes(lowerTerm) || 
                           shortDesc.toLowerCase().includes(lowerTerm) ||
                           billId.toLowerCase().includes(lowerTerm);
                });
                setFilteredData(filtered);
            }, [searchTerm, data]);

            const metrics = useMemo(() => {
                const targetData = filteredData;
                if (!targetData.length) return { total: 0, distinctCPT: 0, distinctTypes: 0 };
                const cpts = new Set(targetData.map(d => d['CPT']).filter(Boolean));
                const types = new Set(targetData.map(d => d['ACTIVITY_TYPE']).filter(Boolean));
                return {
                    total: targetData.length,
                    distinctCPT: cpts.size,
                    distinctTypes: types.size
                };
            }, [filteredData]);

            if (loading) {
                return (
                     <div className="flex h-screen items-center justify-center bg-slate-50">
                        <div className="text-center">
                            <div className="w-12 h-12 border-4 border-brand-200 border-t-brand-600 rounded-full animate-spin mx-auto mb-4"></div>
                            <p className="text-slate-500 font-medium">Loading dataset...</p>
                        </div>
                    </div>
                );
            }

            if (!data.length) {
                return <EmptyState onFileUpload={handleFileUpload} error={error} />;
            }

            return (
                <div className="flex h-screen bg-slate-50 overflow-hidden">
                    <div className="w-64 bg-slate-900 text-white flex flex-col flex-shrink-0 shadow-2xl">
                        <div className="p-6 border-b border-slate-800 flex items-center gap-3">
                            <div className="bg-brand-500 p-2 rounded-lg">
                                <Icon name="activity" size={20} className="text-white" />
                            </div>
                            <div>
                                <h1 className="font-bold text-lg leading-tight">RevCycle<span className="text-brand-400">Pro</span></h1>
                                <p className="text-xs text-slate-400">Charge Analyzer</p>
                            </div>
                        </div>

                        <div className="p-4 flex-1 overflow-y-auto">
                            <div className="mb-8">
                                <p className="text-xs font-bold text-slate-500 uppercase tracking-wider mb-4">Current Dataset</p>
                                <div className="bg-slate-800 p-3 rounded-lg border border-slate-700 text-sm flex items-start gap-2">
                                    <Icon name="file-text" size={16} className="text-slate-400 mt-1 flex-shrink-0" />
                                    <span className="break-all text-slate-300">{fileName}</span>
                                </div>
                            </div>
                            
                            <div className="space-y-2">
                                <button onClick={() => { setData([]); setFilteredData([]); }} className="w-full flex items-center gap-3 p-3 rounded-lg text-slate-300 hover:bg-slate-800 hover:text-white transition-colors">
                                    <Icon name="upload" size={18} />
                                    <span>Load New File</span>
                                </button>
                                <button className="w-full flex items-center gap-3 p-3 rounded-lg bg-brand-600 text-white shadow-lg shadow-brand-900/50">
                                    <Icon name="layout-dashboard" size={18} />
                                    <span>Dashboard</span>
                                </button>
                            </div>
                        </div>
                    </div>

                    <div className="flex-1 flex flex-col overflow-hidden">
                        <div className="h-20 bg-white border-b border-slate-200 flex items-center justify-between px-8 shadow-sm z-10">
                            <h2 className="text-xl font-bold text-slate-800">Charge Master Overview</h2>
                            <div className="flex items-center gap-4">
                                <div className="relative">
                                    <Icon name="search" className="absolute left-3 top-1/2 -translate-y-1/2 text-slate-400" size={18} />
                                    <input 
                                        type="text" 
                                        placeholder="Search CPT, Exam, or ID..." 
                                        className="pl-10 pr-4 py-2 w-80 bg-slate-100 border-none rounded-full text-sm focus:ring-2 focus:ring-brand-500 focus:bg-white transition-all outline-none"
                                        value={searchTerm}
                                        onChange={(e) => setSearchTerm(e.target.value)}
                                    />
                                </div>
                            </div>
                        </div>

                        <div className="px-8 pt-8 pb-4 grid grid-cols-1 md:grid-cols-3 gap-6">
                            <KPICard title="Filtered Items" value={metrics.total.toLocaleString()} subtext={data.length !== filteredData.length ? `of ${data.length} total records` : "Showing all records"} icon="database" color="bg-blue-500" />
                            <KPICard title="Unique CPT Codes" value={metrics.distinctCPT.toLocaleString()} icon="hash" color="bg-emerald-500" />
                             <KPICard title="Activity Types" value={metrics.distinctTypes.toLocaleString()} icon="layers" color="bg-violet-500" />
                        </div>

                        <div className="flex-1 px-8 pb-8 overflow-y-auto overflow-x-hidden">
                            <AnalyticsPanel data={filteredData} />
                            <div className="bg-white rounded-xl shadow-sm border border-slate-200 flex flex-col overflow-hidden min-h-[400px]">
                                <div className="grid grid-cols-12 gap-4 p-4 border-b border-slate-200 bg-slate-50 text-xs font-bold text-slate-500 uppercase tracking-wider sticky top-0 z-10">
                                    <div className="col-span-1">CPT</div>
                                    <div className="col-span-2">Bill Item ID</div>
                                    <div className="col-span-5">Description</div>
                                    <div className="col-span-2">Type</div>
                                    <div className="col-span-2 text-right">Standard Charge</div>
                                </div>
                                <div>
                                    {filteredData.length > 0 ? (
                                        filteredData.map((row, idx) => (
                                            <div key={idx} onClick={() => setSelectedRow(row)} className="grid grid-cols-12 gap-4 p-4 border-b border-slate-100 hover:bg-brand-50 cursor-pointer transition-colors items-center group">
                                                <div className="col-span-1 font-mono text-sm text-slate-600 bg-slate-100 rounded px-2 py-1 w-fit">{row['CPT'] || '--'}</div>
                                                <div className="col-span-2 text-sm font-medium text-slate-700">{row['BILL_ITEM_ID']}</div>
                                                <div className="col-span-5 text-sm text-slate-600 truncate font-medium group-hover:text-brand-700">{row['LONG_DESCRIPTION'] || row['SHORT_DESCRIPTION']}</div>
                                                <div className="col-span-2"><span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-blue-100 text-blue-800">{row['ACTIVITY_TYPE'] || 'N/A'}</span></div>
                                                <div className="col-span-2 text-right font-mono text-sm font-semibold text-slate-800">{row['Charge Point Standard'] || row['Ambulatory Charge Point Tech'] || '-'}</div>
                                            </div>
                                        ))
                                    ) : (
                                        <div className="flex flex-col items-center justify-center py-20 text-slate-400">
                                            <Icon name="search-x" size={48} className="mb-4 opacity-50" />
                                            <p>No results found for "{searchTerm}"</p>
                                        </div>
                                    )}
                                </div>
                            </div>
                        </div>
                    </div>

                    <Modal isOpen={!!selectedRow} onClose={() => setSelectedRow(null)} title="Charge Detail View">
                        {selectedRow && (
                            <div className="space-y-6">
                                <div className="bg-brand-50 p-4 rounded-lg border border-brand-100">
                                    <div className="flex justify-between items-start">
                                        <div>
                                            <h4 className="font-bold text-lg text-brand-900">{selectedRow['LONG_DESCRIPTION']}</h4>
                                            <p className="text-brand-600 text-sm mt-1">{selectedRow['SHORT_DESCRIPTION']}</p>
                                        </div>
                                        <div className="text-right">
                                            <span className="block text-xs uppercase text-brand-400 font-bold">Bill Item ID</span>
                                            <span className="text-xl font-mono font-bold text-brand-800">{selectedRow['BILL_ITEM_ID']}</span>
                                        </div>
                                    </div>
                                </div>
                                <div className="grid grid-cols-1 md:grid-cols-2 gap-x-8 gap-y-2">
                                    {/* Detail rows logic similar to previous version */}
                                    <DetailRow label="CPT Code" value={selectedRow['CPT']} />
                                    <DetailRow label="Activity Type" value={selectedRow['ACTIVITY_TYPE']} />
                                    {Object.keys(selectedRow).filter(k => 
                                        (k.toLowerCase().includes('charge') || k.toLowerCase().includes('point')) && selectedRow[k] 
                                    ).map(key => (<DetailRow key={key} label={key} value={selectedRow[key]} />))}
                                </div>
                            </div>
                        )}
                    </Modal>
                </div>
            );
        };

        const root = ReactDOM.createRoot(document.getElementById('root'));
        root.render(<App />);
    </script>

    <!-- 
      ********************************************
      *** PASTE YOUR DATA BELOW THIS LINE *** ********************************************
      IF YOU WANT TO HARDCODE:
      1. Open your Excel file
      2. Save As -> CSV (Comma Delimited)
      3. Open that CSV in Notepad
